body.script:
// Fetch mtcaptcha configuration from the server
function fetchConfig() {
    let url = '/mtcaptcha-config/?noncargo=true';
    if (location.pathname.indexOf('/cargo') > -1) {
        url = '/mtcaptcha-config/?cargo=true'
    }
    return fetch(url)
        .then(response => response.json())
        .then(config => {
            (function() {
                var mt_service = this.document.createElement('script');
                mt_service.async = true;
                mt_service.src = 'https://service.mtcaptcha.com/mtcv1/client/mtcaptcha.min.js';
                (document.getElementsByTagName('head')[0] || this.document.getElementsByTagName('body')[0]).appendChild(mt_service);
                var mt_service2 = this.document.createElement('script');
                mt_service2.async = true;
                mt_service2.src = 'https://service2.mtcaptcha.com/mtcv1/client/mtcaptcha2.min.js';
                (document.getElementsByTagName('head')[0] || this.document.getElementsByTagName('body')[0]).appendChild(mt_service2);
            })();
            window.mtcaptchaConfig = config;
            console.log('mtcaptcha config loaded', config);

        });
}
fetchConfig();

function mt_jsloadedcb() {
    console.log("mt_jsloadedcb()");
}

function mt_renderedcb(state) {
    console.log("mt_renderedcb(state)");
    console.log("state => " + JSON.stringify(state));
}

function mt_verifiedcb(state) {
    console.log("mt_verifiedcb(state)");
    console.log("state => " + JSON.stringify(state));
}

function mt_verifyexpiredcb(state) {
